import React from 'react';
import '../css/App.css';
import {Link} from 'react-router-dom';

export default class HomePage extends React.Component {

    render() {
        return(
            <div>
                <div className="navbar">
                    <div className="gameTitle">Welcome To Set!!</div>
                    <div className="links">
                        <Link className="linkButton" exact="true" to={"/GamePage"}></Link>
                        <Link className="linkButton" exact="true" to={"/RulePage"}></Link>
                    </div>
                </div>
                <div className="homePageButtons">
                    <Link className="modeButton" exact="true" to={"/GamePage"}>Play</Link>
                    <Link className="modeButton"exact="true" to={"/RulePage"}>Rule</Link>
                </div>
            </div>
        )
    }
}
